    "Range ecosystem management for natural areas",nt"tracking_summary": {ntt"total":
    2,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-07-27T23:06:15.975192",nt"name": "range-ecosystem-management-for-natural-areas",nt"isopen":
    false,nt"url": null,nt"notes": "This report describes methods for managing
    range ecosystems in natural areas.   Preserved natural areas on rangeland may, in
    a short time, be only those which received managed preservation. Rangeland is a
    resource base for wildlife, watersheds, livestock grazing, recreation, and other
    uses. There was, in effect, a symbiotic relationship between rangeland vegetation
    and natural herbivorous species. The natural, free roaming, grass-consuming herbivores
    have been removed. If they were put back, in the absence of space to free roam,
    management problems would be insurmountable. Domesticated livestock can be used
    to fill this niche, produce livestock products, and to eco~ogically benefit the
    range resource. Grazing systems--tailored to the needs of the plant connnunities
    for maintenance of natural areas, aesthetics, and for wildlife benefits offer the
    most adaptable range resource management. Livestock grazing can be used to suppress
    both alien and increaser plants and to promote succession toward a natural equilibrium.
    Management can include one or a combination of the following methods of manipulating
    the vegetation: grazing by domestic animals, mowing, and burning. Each method requires
    a knowledge of the plant community, plant phenology, and the results to be expected
    from such manipulations.",nt"license_title": "License Not Specified",nt"extras":
